// src/components/TelemetryPanel.js
import React from 'react';
import {
  CircularProgressbar,
  buildStyles,
} from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';

import {
  Box,
  Card,
  CardContent,
  Typography,
  Stack,
  Chip,
} from '@mui/material';

const getColor = (value, type) => {
  if (type === 'battery') {
    if (value < 3.7) return '#f44336';
    if (value < 7) return '#ff9800';
    return '#1976d2';
  } else if (type === 'temp') {
    if (value > 70) return '#f44336';
    if (value > 50) return '#ff9800';
    return '#1976d2';
  } else if (type === 'alt') {
    return '#00e676';
  } else if (type === 'imu') {
    return '#00bcd4';
  } else if (type === 'connection') {
    if (value === 'Excellent') return 'success';
    if (value === 'Poor') return 'warning';
    return 'error';
  }
};

const AnimatedGauge = ({ value, max, label, unit, color }) => (
  <Card sx={{ width: '100%', maxWidth: 360, textAlign: 'center', py: 2 }}>
    <CardContent>
      <Typography variant="h6" color="primary">{label}</Typography>
      <Box sx={{ width: 100, mx: 'auto', mt: 2 }}>
        <CircularProgressbar
          value={(value / max) * 100}
          text={`${value.toFixed(1)}${unit}`}
          styles={buildStyles({
            pathColor: color,
            textColor: '#fff',
            trailColor: '#222',
          })}
        />
      </Box>
    </CardContent>
  </Card>
);

const TelemetryPanel = ({ telemetry }) => {
  if (!telemetry) return <Typography color="gray">Waiting for telemetry...</Typography>;

  const {
    battery,
    temperature,
    connection,
    gps,
    altitude,
    roll,
    pitch,
    yaw,
  } = telemetry;

  return (
    <Box
      sx={{
        height: 'calc(100vh - 64px)',
        overflowY: 'auto',
        px: 2,
        py: 2,
        scrollBehavior: 'smooth',
        scrollbarWidth: 'none',
        '&::-webkit-scrollbar': {
          display: 'none',
        },
      }}
    >
      <Stack spacing={2} alignItems="center" justifyContent="flex-start">
        
        {/* Battery */}
        <AnimatedGauge
          value={battery}
          max={12}
          label="üîã Battery"
          unit="V"
          color={getColor(battery, 'battery')}
        />

        {/* Temperature */}
        <AnimatedGauge
          value={temperature}
          max={100}
          label="üå°Ô∏è Temperature"
          unit="¬∞C"
          color={getColor(temperature, 'temp')}
        />

        {/* Altitude */}
        <AnimatedGauge
          value={altitude}
          max={1000}
          label="üß≠ Altitude"
          unit="m"
          color={getColor(altitude, 'alt')}
        />

        {/* IMU Gauges */}
        <AnimatedGauge
          value={roll}
          max={180}
          label="üìà Roll"
          unit="¬∞"
          color={getColor(roll, 'imu')}
        />
        <AnimatedGauge
          value={pitch}
          max={180}
          label="üìà Pitch"
          unit="¬∞"
          color={getColor(pitch, 'imu')}
        />
        <AnimatedGauge
          value={yaw}
          max={360}
          label="üìà Yaw"
          unit="¬∞"
          color={getColor(yaw, 'imu')}
        />

        {/* Connection */}
        <Card sx={{ width: '100%', maxWidth: 360 }}>
          <CardContent>
            <Typography variant="h6" color="primary">üì° Connection</Typography>
            <Chip
              label={connection}
              color={getColor(connection, 'connection')}
              sx={{ mt: 1 }}
            />
          </CardContent>
        </Card>

        {/* GPS */}
        <Card sx={{ width: '100%', maxWidth: 360 }}>
          <CardContent>
            <Typography variant="h6" color="primary">üìç GPS</Typography>
            <Typography variant="body1">
              Lat: {gps?.lat?.toFixed(4)}, Lon: {gps?.lon?.toFixed(4)}
            </Typography>
            <Typography variant="body2">
              Alt: {gps?.alt?.toFixed(2)} m
            </Typography>
          </CardContent>
        </Card>
      </Stack>
    </Box>
  );
};

export default TelemetryPanel;
